window.CUCUMBER_MESSAGES = [{"meta":{"protocolVersion":"18.0.0","implementation":{"name":"cucumber-jvm","version":"7.3.4"},"runtime":{"name":"Java HotSpot(TM) 64-Bit Server VM","version":"11.0.17+10-LTS-269"},"os":{"name":"Windows 10"},"cpu":{"name":"amd64"}}},{"testRunStarted":{"timestamp":{"seconds":1678733201,"nanos":899580600}}},{"source":{"uri":"file:///E:/eclipse%20backup/project1.7/My_Project/src/test/resources/Features/ContactUs.feature","data":"Feature: Contact Us functionality\r\n\r\nScenario: Validate navigating to Contact Us page from Header options\r\nGiven User opens the Application\r\nWhen user Clicks on Phone icon option from the header options\r\nThen user should navigates to Contact Us page\r\n\r\n\r\nScenario: Validate navigating to Contact Us page from Footer options\r\nGiven User opens the Application\r\nWhen user clicks on Contact us link from Footer options\r\nThen user should navigates to Contact Us page\r\n\r\n\r\nScenario: Validate whether the required details and fields are displayed in the Contact Us page\r\nGiven User opens the Application\r\nWhen user Clicks on Phone icon option from the header options\r\nThen user should navigates to Contact Us page\r\nThen user should get required details and fields are proper displayed in the Contact Us page\r\n\r\n\r\nScenario: Validate all the text fields in the Contact Us page are mandatory\r\nGiven User opens the Application\r\nWhen user Clicks on Phone icon option from the header options\r\nThen user should navigates to Contact Us page\r\nThen user should get all the text fields of contact us page are mandetory\r\n\r\n@bug\r\nScenario: Validate submitting the Contact Form in Contact Us page by providing all the details but without logging In\r\nGiven User opens the Application\r\nWhen user Clicks on Phone icon option from the header options\r\nThen user should navigates to Contact Us page\r\nWhen user enters valid description in related field\r\nAnd clicks on submit button of contact us page\r\nThen user should navigates to login page\r\n\r\n#@bug @recheck\r\n#Scenario: Validate submitting the Contact Form in Contact Us page by providing all the details with logging In with valid credentials\r\n#Given User navigates to login page\r\n#When User enters valid email address \"amotooricap1@gmail.com\" into email field\r\n#And User enters valid password \"12345\" into password field\r\n#And User clicks on Login button\r\n#Then User should get successfully logged in\r\n#When user Clicks on Phone icon option from the header options\r\n#Then user should get name as \"Arun\" and email fields \"amotooricap1@gmail.com\" are by default entered with a valid name and email\r\n#When user enters valid description in related field\r\n#And clicks on submit button of contact us page\r\n#Then user should get successful enquirey sent message\r\n\r\n\r\nScenario: Validate submitting the Contact Form in Contact Us page by not providing any details\r\nGiven User opens the Application\r\nWhen user clicks on Contact us link from Footer options\r\nThen user should navigates to Contact Us page\r\nAnd user dont enter anything in all the fields\r\nAnd clicks on submit button of contact us page\r\nThen user should get warning messages for all the fields\r\n\r\n@bug\r\nScenario: Validate entering invalid email address into the E-Mail Address field and submit the form\r\nGiven User opens the Application\r\nWhen user clicks on Contact us link from Footer options\r\nThen user should navigates to Contact Us page\r\nWhen user enters invalid email along with other details\r\nAnd clicks on submit button of contact us page\r\nThen request should not send instead of Confirm with OTP notification should come\r\n\r\n\r\nScenario: Validate the Breadcrumb of Contact Us page\r\nGiven User opens the Application\r\nWhen user clicks on Contact us link from Footer options\r\nThen user should navigates to Contact Us page\r\nThen user should get proper breadcrum for page\r\n\r\nScenario: Validate the Page URL, Page Heading and Page Title of Contact Us page\r\nGiven User opens the Application\r\nWhen user clicks on Contact us link from Footer options\r\nThen user should navigates to Contact Us page\r\nThen user should get proper page title, Page Heading and Page Title of contact us page\r\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///E:/eclipse%20backup/project1.7/My_Project/src/test/resources/Features/ContactUs.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"Contact Us functionality","description":"","children":[{"scenario":{"location":{"line":3,"column":1},"tags":[],"keyword":"Scenario","name":"Validate navigating to Contact Us page from Header options","description":"","steps":[{"location":{"line":4,"column":1},"keyword":"Given ","text":"User opens the Application","id":"6ce94765-92ed-4e30-9307-7366143bf413"},{"location":{"line":5,"column":1},"keyword":"When ","text":"user Clicks on Phone icon option from the header options","id":"212ed879-d168-4235-b349-445885d144e5"},{"location":{"line":6,"column":1},"keyword":"Then ","text":"user should navigates to Contact Us page","id":"ef8eb821-b1f4-4edb-b388-abf19a1e7a10"}],"examples":[],"id":"a986feb6-ea88-4905-8da7-d287c86a9800"}},{"scenario":{"location":{"line":9,"column":1},"tags":[],"keyword":"Scenario","name":"Validate navigating to Contact Us page from Footer options","description":"","steps":[{"location":{"line":10,"column":1},"keyword":"Given ","text":"User opens the Application","id":"2acaecad-a1b2-45ed-859f-2d1569c30a8b"},{"location":{"line":11,"column":1},"keyword":"When ","text":"user clicks on Contact us link from Footer options","id":"45e54904-b853-45fe-9642-770d6d860ca6"},{"location":{"line":12,"column":1},"keyword":"Then ","text":"user should navigates to Contact Us page","id":"5b26d885-0191-45bb-b905-e588d8f7ddcb"}],"examples":[],"id":"46dfb1bb-7e54-4b3f-9785-16a54b6f1f2f"}},{"scenario":{"location":{"line":15,"col  login page\nWhen User enters valid email address \"amotooricap1@gmail.com\" into email field\nAnd User enters invalid password \"1234567890\" into password field\nAnd User clicks on Login button\nThen User should get a proper warning message about credentials mismatch\n\n@nagative\nScenario: Login with invalid email and valid password\nGiven User navigates to login page\nWhen User enters invalid email address into email field\nAnd User enters valid password \"12345\" into password field\nAnd User clicks on Login button\nThen User should get a proper warning message about credentials mismatch\n\n@nagative\nScenario: Login without providing any credentails\nGiven User navigates to login page\nWhen User dont enter email address into email field\nAnd User dont enter password into password field\nAnd User clicks on Login button\nThen User should get a proper warning message about credentials mismatch \n\nScenario: Validate Forgotten Password link is available in the Login page and is working\r\nGiven User navigates to login page\nAnd user should get Forgotten Password link is available on loginpage\nWhen user clicks on Forgotten Password link\nThen user should taken to Forgotten Password Page\n\nScenario: Validate E-Mail Address and Password text fields in the Login page have the placeholder text\nGiven User navigates to login page\nThen user should get proper placeholders for E-Mail Address and Password text fields \n\n@gggg\nScenario: Validate Logging into the Application and browsing back using Browser back button\nGiven User navigates to login page\nWhen User enters valid email address \"amotooricap1@gmail.com\" into email field\nAnd User enters valid password \"12345\" into password field\nAnd User clicks on Login button\nThen User should get successfully logged in\nWhen user clicks on browser back button\nAnd user clicks on browser forward button\nThen User should get successfully logged in\n\n@negative @bug\nScenario: Validate Loggingout from the Application and browsing back using Browser back button\nGiven User navigates to login page\nWhen User enters valid email address \"amotooricap1@gmail.com\" into email field\nAnd User enters valid password \"12345\" into password field\nAnd User clicks on Login button\nThen User should get successfully logged in\nWhen user clicks on logout link\nWhen user clicks on browser back button\nThen user should not get loggedin again\n\n\nScenario: Validate Logging into the Application, closing the Browser without loggingout and opening the application in the Browser again\nGiven User navigates to login page\nWhen User enters valid email address \"amotooricap1@gmail.com\" into email field\nAnd User enters valid password \"12345\" into password field\nAnd User clicks on Login button\nAnd user closes the browser without logging out his account\nWhen user again natigates to url\nThen User should get successfully logged in\n\n@smoke121\nScenario: Validate user is able to navigate to different pages from Login page\nGiven User navigates to login page\nWhen user clicks on Phones module\nThen user should navigates to Phones page\nWhen user clicks on browser back button\nAnd user clicks on Register link\nThen user should navigates to Register account page\nWhen user clicks on browser back button\nWhen user clicks on Cameras module\nThen user should navigates Cameras page\n\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///E:/eclipse%20backup/project1.7/My_Project/src/test/resources/Features/Login.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"Login functionality","description":"","children":[{"scenario":{"location":{"line":4,"column":1},"tags":[{"location":{"line":3,"column":1},"name":"@DDT","id":"fde3e727-70ec-4fdf-b68c-8cb1bdc20ac4"}],"keyword":"Scenario Outline","name":"Login with valid credentials","description":"","steps":[{"location":{"line":5,"column":1},"keyword":"Given ","text":"User navigates to about duplicate email\n\n@ok @negative\nScenario: User creates an account without filling any details\nGiven User navigates to Register Account page\nWhen User dont enter any details into fields\nAnd User clicks on Continue button\nThen User should get proper warning messages for every mandatory field\n\n# newly added scenarios ----------------------------------------------------------------\n\n@ok @negative\nScenario: Validate Registering an Account by providing an invalid email address into the E-Mail field\nGiven User navigates to Register Account page\nWhen User enters the details into below fields for invalid email\n|firstName\t|Arun\t\t\t\t\t\t\t\t\t\t\t\t|\n|lastName\t\t|Motoori\t\t\t\t\t\t\t\t\t\t|\n|telephone\t|1234567890\t\t\t\t\t\t\t\t\t|\n|password\t\t|12345\t\t\t\t\t\t\t\t\t\t\t|\nAnd user enters invalid email as \"jkasb#d2$13@bfh%g.cOm\" in email field\nAnd User selects Yes for Newsletter\nAnd User selects Privacy Policy\nAnd User clicks on Continue button\nThen User should not get Successfully create account page\n\n@bug @negative\nScenario: Validate Registering an Account by providing an invalid phone number\nGiven User navigates to Register Account page\nWhen User enters the details into below fields for invalid phone number\n|firstName\t|Arun\t\t\t\t\t\t\t\t\t\t\t\t|\n|lastName\t\t|Motoori\t\t\t\t\t\t\t\t\t\t|\n|password\t\t|12345\t\t\t\t\t\t\t\t\t\t\t|\nWhen user enters new valid email into the email field\nAnd user enters invalid phone as \"13269761485687546\" in phone field\nAnd User selects Yes for Newsletter\nAnd User selects Privacy Policy\nAnd User clicks on Continue button\nThen User account should not be created\n\n\n@ok\nScenario: Validate all the fields in the Register Account page have the proper placeholders\nGiven User navigates to Register Account page\nThen user should get proper placeholders for all the text fileds\n\n\n@ok @negative\nScenario: Validate whether the Mandatory fields in the Register Account page are accepting only spaces\nGiven User navigates to Register Account page\nWhen User enters the space into all fields\nAnd User selects Yes for Newsletter\nAnd User selects Privacy Policy\nAnd User clicks on Continue button\nThen User should get proper warning messages for every mandatory field\n\n@bug @negative\nScenario: Validate whether the Password fields in the Register Account page are following Password Complexity Standards\nGiven User navigates to Register Account page\nWhen User enters the details into below fields\n|firstName\t|Arun\t\t\t\t\t\t\t\t\t\t\t\t|\n|lastName\t\t|Motoori\t\t\t\t\t\t\t\t\t\t|\n|telephone\t|1234567890\t\t\t\t\t\t\t\t\t|\n|password\t\t|12345\t\t\t\t\t\t\t\t\t\t\t|\nWhen user enters new valid email into the email field\nAnd User selects Privacy Policy\nAnd User clicks on Continue button\nThen user should not get Account success page, instead of should get warning message about Password complexcity standards\n\n@ok1\nScenario: Validate whether the leading and trailing spaces entered into the Register Account fields are trimmed\nGiven User navigates to Register Account page\nWhen User enters the details into below fields\n|firstName\t| Arun \t\t\t\t\t\t\t\t\t\t\t\t|\n|lastName\t\t| Motoori  \t\t\t\t\t\t\t\t\t\t|\n|telephone\t| 1234567890  \t\t\t\t\t\t\t\t|\n|password\t\t|12345\t\t\t\t\t\t\t\t\t\t\t\t|\nWhen user enters new valid email into the email field\nAnd User selects Privacy Policy\nAnd User clicks on Continue button\nThen User account should get created successfully\n\n@ok\nScenario: Validate whether the Privacy Policy checkbox option is not selected by default\nGiven User navigates to Register Account page\nThen user should get unselected Privacy Policy Checkbox by default\n\n@bug\nScenario: Validate whether the Newsletter checkbox is selected by default\r\nGiven User navigates to Register Account page\nThen user should get by defaulted selected Newsletter checkbox\n\n@ok\nScenario: Validate Registering the Account without selecting the Privacy Policy checkbox option\nGiven User navigates to Register Account page\nWhen User enters the details into below fields\n|firstName\t|Arun\t\t\t\t\t\t\t\t\t\t\t\t|\n|lastName\t\t|Motoori\t\t\t\t\t\t\t\t\t\t|\n|telephone\t|1234567890\t\t\t\t\t\t\t\t\t|\n|password\t\t|12345\t\t\t\t\t\t\t\t\t\t\t|\nWhen user enters new valid email into the email field\nAnd User clicks on Continue button\nThen User should get a proper warning message related to privacy policy\n\n@ok\nScenario: Validate navigating to other pages using the options or links provided on the Register Account page\nGiven User navigates to Register Account page\nWhen user clicks on Login link\nThen user should navigates to the Login page\nWhen user clicks on browser back button\nWhen user clicks on Phones module\nThen user should navigates to Phones page\n\n@ok @negative\nScenario: Validate Registring an Account, by filling Password field and not filling Password Confirm field\nGiven User navigates to Register Account page\nWhen User enters the details into below fields except confirm password filed\n|firstName|Arun|\n|lastName|Motoori|\n|telephone|1234567890|\n|password|12345|\nAnd user do not enters password into confirm password field\nWhen user enters new valid email into the email field\nAnd User selects Privacy Policy\nAnd User clicks on Continue button\nThen User should get proper warning message about confirm password field\n\n\n#@abc\n#Scenario: Validate all the mandatory fields in the Register Account page are marked with red color * symbol\n#Given User navigates to Register Account page\n#Then should get all the mandatory fileds along with * symbol","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///E:/eclipse%20backup/project1.7/My_Project/src/test/resources/Features/Register.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"Registration functionality","description":"","children":[{"scenario":{"location":{"line":4,"colu
